  false,\n\t\"url\": null,\n\t\"notes\": \"Polygons represent head scarps and flank
  scarps associated with landslide deposits in the Little North Santiam River Basin,
  Oregon. This work was completed as part of the Master's thesis \"Turbidity Monitoring
  and LiDAR Imagery Indicate Landslides are Primary Source of Suspended-Sediment Load
  in the Little North Santiam River Basin, Oregon, Winter 2009-2010\" by Steven Sobieszczyk,
  Portland State University and U.S. Geological Survey. Data layers in this geodatabase
  include: landslide deposit boundaries (Deposits); field-verfied location imagery
  (Photos); head scarp or scarp flanks (Scarp_Flanks); and secondary scarp features
  (Scarps).The geodatabase template was developed by the Oregon Department of Geology
  and Mineral Industries (Burns and Madin, 2009).\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
